def fix_strictly_increasing_by_one_clamp(nums):
    n = len(nums)
    if n <= 2:
        return True

    def is_strict(a):
        return all(a[i] < a[i+1] for i in range(len(a) - 1))

    if is_strict(nums):
        return True

    for i in range(1, n - 1):
        lo = nums[i - 1] + 1
        hi = nums[i + 1] - 1
        if lo > hi:
            continue

        v = nums[i]

        if v < lo:
            v = lo
        elif v > hi:
            v = hi

        candidate = nums[:]
        candidate[i] = v
        if is_strict(candidate):
            return True

    return False
