def first_distinct_majority_split(vals):
    if not vals:
        return None

    suffix = {}
    for x in vals:
        suffix[x] = suffix.get(x, 0) + 1

    seen = set()
    for i, x in enumerate(vals):
        seen.add(x)
        suffix[x] -= 1
        if suffix[x] == 0:
            del suffix[x]
        if len(seen) > len(suffix):
            return i

    return None

